Sure, we were wearing masks, and it was for only an hour...But we decided today that we’re not going to let the limitations of stage four stop us from still making memories and enjoying what we can. 

Life is definitely not ‘normal’ at the moment, but these little niceties definitely lifted our spirits, and allowed us to escape into a sense of normalcy (sort of 😉) for sixty minutes today.

How are you feeling this weekend? Over it? Okay? Kind of, alright? What did you get up to for your hour outside? Or, perhaps you’d rather not go outside at all today, and that’s ok too. I think this time is all about doing what is best for us personally, and taking care of what we can x";}i:121;a:1:{s:14:"comments_count";i:3;}i:122;a:1:{s:11:"likes_count";i:30;}i:123;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvRlOhg2IF";}i:124;a:1:{s:5:"image";s:238:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/118615795_329796025129010_7574419744253576401_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=102&_nc_ohc=3zUpbFa5HXwAX-PjzJd&oh=1e5c93f2f6ae724ce1f27095462c44bf&oe=5F7E1E4C";}i:125;a:1:{s:4:"type";s:5:"image";}i:126;a:1:{s:8:"owner_id";i:1650263114;}i:127;a:1:{s:14:"owner_username";s:0:"";}i:128;a:1:{s:14:"owner_fullname";s:0:"";}i:129;a:1:{s:9:"owner_pic";s:0:"";}i:130;a:1:{s:2:"id";s:19:"2391203812776985525";}i:131;a:1:{s:10:"short_code";s:11:"CEvQzLWIcO1";}i:132;a:1:{s:12:"created_time";i:1599273729;}i:133;a:1:{s:7:"caption";s:1925:"4040 метров- это  пока максимальная высота, на которую мы забирались. 

Это был подъём на Эльбрус... на канатной дороге )

С Поляны Азау идут две канатные дороги: Новая - классическая гондола (немного дороже).
Старая похожа на подвесные трамвайчики, ехать нужно стоя, в кабинку за один раз запускают 12 человек, странное расписание из-за которого нужно долго ждать.
Канатная дорога состоит их трех этапов. Первый до станции Кругозор – 3000 метров, вторая до станции Мир 3500 метров, третья до Гарабаши 3780 метров. А дальше пешком можно добраться до этой красивой отметки в 4040 метров (абсолютная высота Эльбруса 5642 метров).
Так же здесь находятся так называемые «Бочки». Это упрощенный вариант гостиниц, где есть все необходимое для проживания. В бочках туристы проходят адаптацию перед восхождением на Эльбрус 🏞
